@jeffreyjohnbell @geofflath That masks work is beyond dispute at this point. Image is from a CDC summary of mask studies.

KN95/N95 masks are better, because of better fit. And you can use them more than once. Hardware stores have them (as dust masks).

https://t.co/JqK9yNf9wB https://t.co/sISo7Hs2WJ

@Unicorn_999 @100outta15cents @rubin_allergy Because those are the important points!

The disease is endemic - we're not going to bring counts to zero. However, we can reduce the chance of people suffering from severe illness and death.

Vaccines prevent severe illness and death. They reduce burdens on health care systems.
